import React from 'react';

const Docs = () => (
  <div className="p-6">
    <h1 className="text-2xl font-bold mb-4">Documentation</h1>
    <ul className="list-disc pl-6 text-gray-700 space-y-2">
      <li>Supplier Replenishment Guide</li>
      <li>EDI Specs</li>
      <li>Global Sourcing Supplier Manual</li>
      <li>Order Management System Docs</li>
      <li>Product Safety Guidelines</li>
    </ul>
  </div>
);

export default Docs;
